package main

import (
	"context"
	"fmt"
	"github.com/theinpu/canon_parser/server"
	"google.golang.org/grpc"
	"log"
)

var enc = ``

var enc1 = ``

func main() {
	conn, err := grpc.Dial(":8080", grpc.WithInsecure())
	if err != nil {
		log.Fatalln(err)
	}

	defer conn.Close()

	client := server.NewParserIOClient(conn)

	out, err := client.Parse(context.Background(), &server.Input{EncodedHTML: enc})
	if err != nil {
		log.Fatalln(err)
	}

	fmt.Printf("titles: %v\nlinks: %v\n", out.Title, out.Canonical)

	out, err = client.Parse(context.Background(), &server.Input{EncodedHTML: enc1})
	if err != nil {
		log.Fatalln(err)
	}

	fmt.Printf("titles: %v\nlinks: %v\n", out.Title, out.Canonical)
}
